pragma solidity ^0.4.24;

/*
 * @title: VTF factory
 * Factory to initialize token, controller, registry contract
 * Created on 2019-01, by Bankorus, NZ
 */

import "openzeppelin-solidity/contracts/lifecycle/Pausable.sol";

import './interfaces/IRegistry.sol';
import './interfaces/IController.sol';
import './interfaces/IToken.sol';

import './Registry.sol';
import './BankorusToken.sol';
import './Controller.sol';

contract BankorusFactory is Pausable {
    address public controllerAddress;
    address public tokenAddress;
    address public registryAddress;
    event NewVTF(address token, address controller, address registry, address owner, uint256 createdAt);
    function create(
        string _name,
        string _symbol, 
        uint8 _decimal,
        uint256 _totalSupply, 
        uint256 _createdAt, 
        string _regulation
    ) 
    public
    whenNotPaused 
    returns(address, address, address) 
    {
        IRegistry registry = new Registry();
        IRegistry[] memory registries = new IRegistry[](1);
        registries[0] = IRegistry(registry);
        IController controller = new Controller(registries, 1);

        IToken token = new BankorusToken(
            IController(controller), 
            _name, 
            _symbol, 
            _decimal,
            _totalSupply,
            _createdAt, 
            _regulation
        );

        emit NewVTF(token, controller, registry, msg.sender, now);
        controllerAddress = address(controller);
        tokenAddress = address(token);
        registryAddress = address(registry);
    }
}
